import React from "react";
import "../App.css";
import human from "./khylecv24.jpg";
import { styled } from "@chakra-ui/react";

function Resume() {

    const styles = () => {
        return {
            margin: "auto",
            width: "50%",
            border: "3px solid #73AD21",
            padding: "10px"
        }
    }

    return (
        <div id="resume" className="RES">
            <img src={human} alt="resume" />
        </div>
    );
}

export default Resume;
